import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image, SafeAreaView, Button, Alert, Platform } from 'react-native';


<link rel="stylesheet" href="https://use.typekit.net/kqi1wco.css"></link>


export default function App() {
//Defining a function for pressing text
console.log("App executed");
const handlePress = () => console.log("Text pressed");

  return (
    <SafeAreaView style={styles.container}>
      <Text numberOfLines={1} onPress={handlePress} style={styles.title}>
        CoinCoin
      </Text>
      <Image fadeDuration={1000} style={styles.coinPic} source={require("./assets/coins/ada.png")}/>
      <Button style={styles.buttonStyle} title="Add coin" onPress={() => Alert.alert("Add coin", "Do you wish to add a coin?", [
        {text: "Yes"},
        {text: "No"},
      ]) }/>
      <Text>
      Bitcoin
      123
      </Text>



    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    paddingTop: Platform.OS === "android"? 20 : 0 //If its android, set it to 20 otherwise 0
  },



  title:{
    color:"#0000ff",
    fontFamily: "Montserrat",
    fontStyle: "normal",
    fontWeight: "700",
    fontSize:48

  },

  coinPic:{
    width: 128, 
    height: 128,
    marginBottom: 15,

  },

  buttonStyle:{
    color: "#0000ff",
    width: 100,
    height: 200,
  }
  ,
});
